class Solution 
{ 
    String firstRepChar(String s) 
    { 
       HashSet<Character> l=new HashSet<>();
       String str="";
       for(int i=0;i<s.length();i++){
           if(l.contains(s.charAt(i))){
               str=str+s.charAt(i);
               return str;
           }
           l.add(s.charAt(i));
       }
       return "-1";
    }
}

